window.css={extractSelectors(obj,type="all"){if(!obj||"object"!=typeof obj)throw new TypeError("First parameter must be an object");var validTypes=["all","css","xpath"];if(validTypes.includes(type))return obj=Object.values(obj).flatMap(val=>val&&"object"==typeof val?this.extractSelectors(val,type):"string"==typeof val?[val]:[]),"css"==type?obj.filter(sel=>sel&&!sel.startsWith("//")):"xpath"==type?obj.filter(sel=>sel&&sel.startsWith("//")):obj;throw new TypeError("Type must be one of: "+validTypes.join(", "))}};